import React from "react";
import HighlightIcon from "@material-ui/icons/Highlight";
import { Navbar, Nav } from "react-bootstrap";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function Header (){

    return (
        <header>
          <h1>
            <HighlightIcon />
            Michael Powell
          </h1>
        </header>
      );
}

export default Header;
